description:
Full HD (1920x1080) Blu-ray rips of season 1.

Comes with 5.1 audio for the episodes, along with secondary 2.0 audio commentary tracks for seven episodes.

Includes 11 subtitles tracks: English (forced, for the non-English dialogue in the show), English (full dialogue subtitles), French, Spanish, Portuguese, Polish, Dutch, Danish, Finnish, Norwegian, Swedish

No extras besides the audio commentaries are included - Buy the Blu-ray box yourself if you want them! This show is definitely worth it.

Enjoy!

